    fn update(&mut self, message: Message) -> Task<Message> {
        match message {
            Message::Digit(digit) => {
                if self.waiting_for_operand {
                    if let Some(op) = self.operation {
                        let op_symbol = match op {
                            Operation::Add => "+",
                            Operation::Subtract => "-",
                            Operation::Multiply => "×",
                            Operation::Divide => "÷",
                        };
                        self.history = ::alloc::__export::must_use({
                            ::alloc::fmt::format(
                                format_args!("{0} {1} ", self.display, op_symbol),
                            )
                        });
                    }
                    self.display = digit.to_string();
                    self.waiting_for_operand = false;
                } else {
                    if self.display == "0" {
                        self.display = digit.to_string();
                    } else {
                        self.display.push_str(&digit.to_string());
                    }
                }
            }
            Message::Decimal => {
                if self.waiting_for_operand {
                    if let Some(op) = self.operation {
                        let op_symbol = match op {
                            Operation::Add => "+",
                            Operation::Subtract => "-",
                            Operation::Multiply => "×",
                            Operation::Divide => "÷",
                        };
                        self.history = ::alloc::__export::must_use({
                            ::alloc::fmt::format(
                                format_args!("{0} {1} ", self.display, op_symbol),
                            )
                        });
                    }
                    self.display = "0.".to_string();
                    self.waiting_for_operand = false;
                } else {
                    if !self.display.contains('.') {
                        self.display.push('.');
                    }
                }
            }
            Message::Operation(op) => {
                if let Ok(value) = self.display.parse::<f64>() {
                    if let Some(first) = self.first_operand {
                        if let Some(current_op) = self.operation {
                            let result = self.calculate(first, value, current_op);
                            self.display = format_number(result);
                            let op_symbol = match current_op {
                                Operation::Add => "+",
                                Operation::Subtract => "-",
                                Operation::Multiply => "×",
                                Operation::Divide => "÷",
                            };
                            self.history = ::alloc::__export::must_use({
                                ::alloc::fmt::format(
                                    format_args!("{0} {1} {2} = ", first, op_symbol, value),
                                )
                            });
                            self.first_operand = Some(result);
                        }
                    } else {
                        self.first_operand = Some(value);
                        let op_symbol = match op {
                            Operation::Add => "+",
                            Operation::Subtract => "-",
                            Operation::Multiply => "×",
                            Operation::Divide => "÷",
                        };
                        self.history = ::alloc::__export::must_use({
                            ::alloc::fmt::format(
                                format_args!("{0} {1} ", value, op_symbol),
                            )
                        });
                    }
                    self.operation = Some(op);
                    self.waiting_for_operand = true;
                }
            }
            Message::Equals => {
                if let (Ok(value), Some(first), Some(op)) = (
                    self.display.parse::<f64>(),
                    self.first_operand,
                    self.operation,
                ) {
                    let result = self.calculate(first, value, op);
                    let op_symbol = match op {
                        Operation::Add => "+",
                        Operation::Subtract => "-",
                        Operation::Multiply => "×",
                        Operation::Divide => "÷",
                    };
                    self.history = ::alloc::__export::must_use({
                        ::alloc::fmt::format(
                            format_args!("{0} {1} {2} = ", first, op_symbol, value),
                        )
                    });
                    self.display = format_number(result);
                    self.first_operand = None;
                    self.operation = None;
                    self.waiting_for_operand = true;
                }
            }
            Message::ClearEntry => {
                self.display = "0".to_string();
            }
            Message::Clear => {
                self.display = "0".to_string();
                self.history = "".to_string();
                self.first_operand = None;
                self.operation = None;
                self.waiting_for_operand = false;
            }
            Message::Backspace => {
                if self.display.len() > 1 {
                    self.display.pop();
                } else {
                    self.display = "0".to_string();
                }
            }
            Message::PlusMinus => {
                if let Ok(value) = self.display.parse::<f64>() {
                    self.display = format_number(-value);
                }
            }
            Message::SquareRoot => {
                if let Ok(value) = self.display.parse::<f64>() {
                    if value >= 0.0 {
                        self.display = format_number(value.sqrt());
                    } else {
                        self.display = "Invalid input".to_string();
                    }
                }
            }
            Message::Square => {
                if let Ok(value) = self.display.parse::<f64>() {
                    self.display = format_number(value * value);
                }
            }
            Message::Percentage => {
                if let Ok(value) = self.display.parse::<f64>() {
                    self.display = format_number(value / 100.0);
                }
            }
            Message::Reciprocal => {
                if let Ok(value) = self.display.parse::<f64>() {
                    if value != 0.0 {
                        self.display = format_number(1.0 / value);
                    } else {
                        self.display = "Cannot divide by zero".to_string();
                    }
                }
            }
            Message::ShowList => {}
            Message::ToggleAlwaysOnTop => {
                if let Some(window_id) = self.window_id {
                    self.always_on_top = !self.always_on_top;
                    return Task::window(
                        window::Action::ChangeLevel(
                            window_id,
                            if self.always_on_top {
                                window::Level::AlwaysOnTop
                            } else {
                                window::Level::Normal
                            },
                        ),
                    );
                }
                Task::none()
            }
            Message::WindowEvent(id, event) => {
                if self.window_id.is_none() {
                    self.window_id = Some(id);
                }
                match event {
                    window::Event::CloseRequested => {
                        return Task::window(window::Action::Close(id));
                    }
                    _ => {}
                }
            }
            Message::Ignore => {}
        }
        Task::none()
    }
    fn calculate(&self, first: f64, second: f64, op: Operation) -> f64 {
        match op {
            Operation::Add => first + second,
            Operation::Subtract => first - second,
            Operation::Multiply => first * second,
            Operation::Divide => if second != 0.0 { first / second } else { f64::NAN }
        }
    }
