fn format_number(value: f64) -> String {
    if value.is_nan() {
        "Error".to_string()
    } else if value.is_infinite() {
        "Infinity".to_string()
    } else {
        if value.fract() == 0.0 && value.abs() < 1e15 {
            ::alloc::__export::must_use({
                ::alloc::fmt::format(format_args!("{0}", value as i64))
            })
        } else if value.abs() >= 1e15 || (value.abs() < 1e-4 && value != 0.0) {
            ::alloc::__export::must_use({
                ::alloc::fmt::format(format_args!("{0:.6e}", value))
            })
        } else {
            ::alloc::__export::must_use({
                    ::alloc::fmt::format(format_args!("{0:.10}", value))
                })
                .trim_end_matches('0')
                .trim_end_matches('.')
                .to_string()
        }
    }
}
